class HXHPass(TransformationPass):
    def run(self, dag: DAGCircuit) -> DAGCircuit:
        for node in list(dag.op_nodes()):
            if isinstance(node.op, ZGate):
                replacement_dag = DAGCircuit()
                qr = QuantumRegister(1)
                replacement_dag.add_qreg(qr)
                replacement_dag.apply_operation_back(HGate(), [qr[0]])
                replacement_dag.apply_operation_back(XGate(), [qr[0]])
                replacement_dag.apply_operation_back(HGate(), [qr[0]])
                dag.substitute_node_with_dag(node, replacement_dag)
        return dag
